import { Autocomplete } from '@material-ui/lab'
import React from 'react'

const convertEventParameter = (name, value) => ({
    target: {
        name, value
    }
})

export default function SelectInput(props) {
    const {style, options, classes, getOptionLabel, renderOption, renderInput, name, value, onChange, ...other} = props; 
    return (
        <Autocomplete
            style={style}
            options={options}
            classes={classes}
            autoHighlight
            getOptionLabel={getOptionLabel}
            renderOption={renderOption}
            renderInput={renderInput}
            name={name}
            value={value}
            onChange={(e, v) => onChange(convertEventParameter(name, v.label))}
            {...other}
      />
    )
}
